import React from "react";
import DeleteIcon from '@mui/icons-material/Delete';
import AddIcon from '@mui/icons-material/Add';

function Note(props) {


    return <div className='note'>
        <h1>{props.title}</h1>
        <p>{props.content}</p>
        <button onClick={() => props.delete((props.id))}>
            <DeleteIcon />
        </button>
    </div>
}

export default Note;
